body:
Possibly needs another change in https://github.com/onnx/onnx/pull/2724.

```
std::string DataTypeUtils::ToDataTypeString(int32_t tensor_data_type) {
  TypesWrapper& t = TypesWrapper::GetTypesWrapper();
  auto iter = t.TensorDataTypeToTypeStr().find(tensor_data_type);
  assert(t.TensorDataTypeToTypeStr().end() != iter);
  return iter->second;
}

```
Instead of the `assert` which wouldn't fire in a release build, ToDataTypeString could return an error status (similar to other changes in that PR)
